import React from "react";
import {Button} from "reactstrap";

const range = len => {
  const arr = [];
  for (let i = 0; i < len; i++) {
    arr.push(i);
  }
  return arr;
};

const newTransfer = (ref,date,c1,c2,m,act) => {
  return {
    reference: ref,
    executionDate: date,
    principalAccount: c1,
    beneficiaryAccount: c2,
    totalAmount: m,
    stateAction: act
  };
};

export function makeData(transfers) {
  return range(transfers.length).map(transfer => {
    return {
      ...newTransfer(),
      children: range(10).map(newTransfer)
    };
  });
}
